[Windows] cmd/dockerd: create panic.log file without readonly flag","distinct":true,"url":"https://api.github.com/repos/jongwu/moby/commits/c09789c1140a3b2e399b0c77c449b34d000e2362"},{"sha":"0da3f192c5607ecdcf109a1b59c6c50907d6e9d0","author":{"email":"89cfe2d27aa9d3162d71386e267765840edc808a@arm.com","name":"Jianyong Wu"},"message":"runtime: enable optional containerd-shim based runtime support

Some runtimes, e.g. Kata Containers, has no OCI runtime binary but a
containerd-shim based runtime. To support these kind of things, shim
config must be export to user config.

For example, if user want to add kata as its runtime, there are 2 steps to
go:
First, add kata runtime to daemon config file like:

{
   "runtimes":{
      "io.containerd.kata.v2":{
         "shim":{
            "binary":"io.containerd.kata.v2"
         }
      }
   }
}

Second, specify kata runtime using "--runtime io.containerd.kata.v2" in
command line.

